import './master.css';
import './SearchResult.css'
import React from 'react';

const SearchResult = (props) => {
  return (
    <div className="result d-flex flex-row justify-content-around">
      <div>
        <img src={props.img} />
      </div>
      <div>
        <a className="club-name">{props.text}</a>
        <p className="club-description">I'm baby hell of helvetica cray ugh, fashion axe kombucha taxidermy flexitarian. Narwhal literally gochujang, 8-bit succulents cloud bread DIY scenester portland cornhole williamsburg before they sold out humblebrag. Pop-up VHS crucifix deep v pork belly forage slow-carb, raw denim tousled roof party man bun.</p>
      </div>
    </div>
  );
};

export default SearchResult;
